    false,nt"url": null,nt"notes": "Water and sediment samples were collected
    from Key Cave and analyzed for 20 metals and 78 organic chemicals. Results indicated
    the presence of p,p'-DDE and elevated concentrations of seven metals (Al, B, Be,
    Fe, Mn, Ni, Zn) in sediment. Restrictions on land application of sewage sludge,
    implementation of an integrated pest management program, and a 12-month monitoring
    program are recommended.",nt"license_title": "License Not Specified",nt"extras":
